import React from 'react';


export class Prizes extends React.Component {

    constructor(props) {
        super(props);
        var prizeArr = this.createPrizeArr();
    }

    createPrizeArr() {
        var prizeArr = ['Prize 1', 'Prize 2', 'Prize 3', 'Prize 4'];
    }

    render() {

        var refers = this.props.refers;

        if (refers === 0)
        {
            return (
                <ul>
                    <li>Prize 1</li>
                </ul>
            );
        }
        else if (refers > 0 && refers < 2)
        {
            return (
                <ul>
                    <li>Prize 1</li>
                    <li>Prize 2</li>
                </ul>
            );
        }

        return (
            <h1>
                {this.props.refers}
          </h1>
        );
    }
}

export default Prizes;
